import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function Login() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:8000/api/token/', {
        username,
        password,
      });
      localStorage.setItem('access_token', response.data.access);
      localStorage.setItem('refresh_token', response.data.refresh);
      navigate('/');
    } catch (err) {
      setError('Credenciais inválidas. Tente novamente.');
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-[#202124]">
      <div className="w-full max-w-[450px] bg-[#202124] p-12 rounded-2xl border border-gray-700">
        {/* Logo */}
        <div className="flex justify-center mb-8">
          <img
            src="https://www.levesaude.com.br/build/assets/logo-menu-leve-5752d94b.png"
            alt="Leve Saúde"
            className="h-16 transform hover:scale-110 transition-transform duration-300"
          />
        </div>

        {/* Title and Subtitle */}
        <div className="text-center mb-8">
          <h1 className="text-2xl font-normal text-white mb-2">Fazer login</h1>
          <p className="text-sm text-gray-400">Ir para o Leve Saúde</p>
        </div>

        <form onSubmit={handleLogin} className="space-y-6">
          {/* Username Input */}
          <div className="space-y-2">
            <input
              id="username"
              type="text"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              className="w-full px-4 py-3 bg-transparent border border-gray-600 rounded-md text-white placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
              placeholder="Digite seu usuário"
              required
            />
          </div>

          {/* Password Input */}
          <div className="space-y-2">
            <input
              id="password"
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              className="w-full px-4 py-3 bg-transparent border border-gray-600 rounded-md text-white placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
              placeholder="Digite sua senha"
              required
            />
          </div>

          {/* Error Message */}
          {error && (
            <div className="animate-shake">
              <p className="text-red-400 text-sm text-center p-3 rounded-md bg-red-900/30 border border-red-700">
                {error}
              </p>
            </div>
          )}

          {/* Action Buttons */}
          <div className="flex flex-col space-y-6 mt-8">
            {/* Create Account Link */}
            <div className="flex items-center justify-between">
              <a href="#" className="text-sm text-blue-400 hover:text-blue-300">
                Esqueceu a senha?
              </a>
            </div>

            {/* Login Button */}
            <div className="flex justify-end">
              <button
                type="submit"
                className="bg-blue-500 text-white px-6 py-2 rounded-md hover:bg-blue-600 transition-colors duration-200 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 focus:ring-offset-[#202124]"
              >
                Próxima
              </button>
            </div>
          </div>
        </form>

        {/* Footer */}
        <div className="mt-8 pt-6 border-t border-gray-700">
          <div className="flex justify-between items-center">
            <select className="bg-transparent text-gray-400 text-sm border-none focus:outline-none cursor-pointer">
              <option value="pt-BR">Português (Brasil)</option>
            </select>
            <div className="flex space-x-4">
              <a href="#" className="text-sm text-gray-400 hover:text-gray-300">Ajuda</a>
              <a href="#" className="text-sm text-gray-400 hover:text-gray-300">Privacidade</a>
              <a href="#" className="text-sm text-gray-400 hover:text-gray-300">Termos</a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Login;
